import {BitcoinComponent} from '../Components/BitcoinComponent'
import {EthereumComponent} from '../Components/EthereumComponent'
import axios from 'axios'

const Home: React.FC = () => {

    useEffect(() => {
        const pricesWs = new WebSocket('wss://ws.coincap.io/prices?assets=bitcoin,ethereum')

        pricesWs.onmessage = function (msg) {
            console.log(msg.data)
        }

    }, [])

    return(
        <div>
            <BitcoinComponent />
            <EthereumComponent />
        </div>
    )
}

export default Home;
